import { Component } from '@angular/core';

@Component({
  selector: 'app-registration-error-modal',
  templateUrl: './registration-error-modal.component.html',
  styleUrls: ['./registration-error-modal.component.css']
})
export class RegistrationErrorModalComponent {

}
<h2 mat-dialog-title>Error</h2>
<mat-dialog-content>
  <p>User already registered.</p>
</mat-dialog-content>
<mat-dialog-actions>
  <button mat-button mat-dialog-close>Close</button>
</mat-dialog-actions>
